import React from "react";
import ReactDOM from "react-dom";

class App extends React.Component {
  render() {
    return (
      <div className="ui container">
        <div>
          Select a language
          <i onClick={this.onLanguageChange} className="ui flag us" />
          <i onClick={this.onLanguageChange} className="ui flag nl" />
        </div>
      </div>
    );
  }
}

export default App;
